import React, { useState, useEffect } from "react";

const UserList = () => {
  let [alldata, updateAlldata] = useState([]);
  const getuserinfo = () => {
    fetch("http://localhost:1250/details")
      .then((response) => response.json())
      .then((info) => {
        updateAlldata(info);
      });
  };
  useEffect(() => {
    getuserinfo();
    console.log(alldata);
  }, [1]);
  return (
    <div className="container mt-5">
      <div className="row">
        <div className="col-lg-3 border">
          <h4>Available Profile</h4>
          <div>
            {alldata.map((data, index) => {
              return (
                <div key={index}>
                  <li className=" list-group text-primary">
                    <a href="/targ" target="iframe_a">
                      {data.firstname}
                    </a>
                  </li>
                </div>
              );
            })}
          </div>
        </div>
        <div className="col-lg-9">
          <div id="targ">
            <iframe
              name="iframe_a"
              height="300px"
              width="100%"
              className="border:none"
            >
              <table>
                <thead>
                  {alldata.map((abc, index) => {
                    return (
                      <tr key={index}>
                        <th>Name : {alldata.firstname}</th>
                      </tr>
                    );
                  })}
                </thead>
              </table>
            </iframe>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserList;
